import React from 'react';
import './Alerts.css';

function Alerts() {
  return (
    <div className="alerts">
      <h3>Alerts</h3>
      <p>Alerts and notifications related to drone operations will be shown here.</p>
    </div>
  );
}

export default Alerts;
